import React from 'react';
import { Button } from './Button';

export function List(props) {

  return (
    <ul className="App-list">
      {props.items.map((item, i) => (
        <li key={i}>
          <h4>{item.name}</h4>
          <p>{item.model}</p>
          <Button labelBtn="Edit" handleBtn={props.addItem} />
          <Button labelBtn="Delete" handleBtn={props.deleteItem(i)} />
        </li>
      ))}
    </ul>
  )
}
